import styled from "styled-components";
import { Nav } from "react-bootstrap";

export const StyledNavMain = styled(Nav.Link)`
  padding-bottom: 0px;
  font-weight: bold;
`;

export const StyledNavSub = styled(Nav.Link)`
  color: rgba(0, 0, 0, 1);
  padding-top: 0px;
  padding-bottom: 0px;
`;
